svg.script:
let highlight = function () {
	let fn = () => this.style.opacity = 1;
	this.style.opacity = 0.5;
	//this.style.fill = "#00aaee";
	setTimeout(fn, 110);
}
let resetAlgo = () => {
	document.getElementById("A").style.opacity = 1;
	document.getElementById("L").style.opacity = 1;
	document.getElementById("G").style.opacity = 1;
	document.getElementById("O").style.opacity = 1;
}
let wave = () => {
	for (let i=0; i<30; i++) {
		let circles = document.getElementsByClassName("d" + i);
		for (c of circles) {
			let h = highlight.bind(c);
			setTimeout(h, 60*i);
		}
	};
	setTimeout('document.getElementById("A").style.opacity = 0.7',  300);
	setTimeout('document.getElementById("L").style.opacity = 0.7',  700);
	setTimeout('document.getElementById("G").style.opacity = 0.7', 1100);
	setTimeout('document.getElementById("O").style.opacity = 0.7', 1500);
	setTimeout(resetAlgo, 2500);
}
wave();
setInterval(wave, 5000);
document.ondblclick = wave;
